comments.message:
We can't rely on just updating "@odata.id" fields.  For example, we need to update the URIs under a Chassis' "Action" property

"Actions": {
    "#Chassis.Reset": {
      "@Redfish.ActionInfo": "/redfish/v1/Chassis/ChassisID/ResetActionInfo",
      "target": "/redfish/v1/Chassis/ChassisID/Actions/Chassis.Reset"
    }


That's why earlier in previous patchsets I moved away from using "@odata.id" and instead attempted to add a prefix to any values that were strings.
